import React from 'react';
import Navbar from './NavBar'; // Ensure the import path is correctt
import '../styles/Featurepage.css'; // Use this CSS file for both features

const VideoDeepfake = () => {
  return (
    <div>
      <Navbar />
      <div className="feature-content">
        <h1>Video Deepfake Detection</h1>
        <p>Our video deepfake detection tool uses advanced algorithms to identify manipulated videos. Stay ahead in identifying fake videos with our technology.</p>
      </div>
    </div>
  );
};

export default VideoDeepfake;
